function verificaForm(value) {
    /* class valida */
    let formSelect = document.querySelectorAll(`#${value} select.valida`);
    let formInput = document.querySelectorAll(`#${value} input.valida`);
    let formTextarea = document.querySelectorAll(`#${value} textarea.valida`);
    let count = 0;
    count =
        checaForm(formInput) + checaForm(formSelect) + checaForm(formTextarea);
    if (count === 0) return true;
    else return false;
}

function checaForm(form) {
    let count = 0;
    form.forEach((item) => {
        if (item.value == "" || item.value === undefined) {
            count++;
            item.classList.add("is-invalid");
        } else {
            item.classList.remove("is-invalid");
        }
    });
    return count;
}

function resetFields(value) {
    /* reseta a validao dos campos valida */
    let formSelect = document.querySelectorAll(`#${value} select.valida`);
    let formInput = document.querySelectorAll(`#${value} input.valida`);
    let formTextarea = document.querySelectorAll(`#${value} textarea.valida`);
    resetBorderFields(formSelect);
    resetBorderFields(formInput);
    resetBorderFields(formTextarea);
}

function resetBorderFields(fields) {
    fields.forEach((item) => {
        item.classList.remove("is-invalid");
    });
}

/* ALERT */
var Toast = Swal.mixin({
    toast: false,
    position: "top-end",
    showConfirmButton: false,
    timer: 3000,
});

/* MODAL ACIMA DE OUTRO MODAL */
$("body").on("hidden.bs.modal", ".modal-personal", function () {
    $("body").addClass("modal-open");
});

/* CONVERTER O HASH DA DESCRIO DA ENTREGA EM TAG'S HTML  */
function convertStringToHTML(str) {
    let parser = new DOMParser();
    let doc = parser.parseFromString(str, "text/html");
    return doc.body;
}

/* PAGINATE */
function getLabelPage(str) {
    if (str == "&laquo; Previous") return "<<";
    else if (str == "Next &raquo;") return ">>";
    else return str;
}

/* PEGAR AS FOTOS DE ACORDO COM O ID DO PROGRAMA */
function mostrarFoto(src, programa_id) {
    let url;

    if (programa_id == 1) url = "../FOTO_FAIXA";
    else if (programa_id == 3) url = "../FOTO_PNP";

    return url + "/" + src;
}

/* BAIXAR O ARQUIVO COMPLEMENTAR */
function downloadArquivoCompl(arq) {
    window.open("../analiseSup/arquivos-complementares/" + arq);
}
